result:
query($id: ID!) {
  person(id: $id) {
      path
      content
      name
      rank
      memberships{
        id
        title
        path
      }
      projects{
        id
        title
        path
        logo
      }
      bio
      excerpt
      linkedin
      websites
      countries
      cities
      private
      image(width:150, height:150)
      belongsTo {
      totalCount
      pageInfo {
        totalPages
        currentPage
      }
      edges {
        node {
          ... on Blog {
            id
            title
            excerpt
            image(width:800)
            path
            timeToRead
            humanTime : created(format:"DD MMM YYYY")
            datetime : created
            authors {
              id
              name
              image(width:64, height:64, fit:inside)
              path
            }
          },
          ... on Project {
            id
            title
            excerpt
            image(width:800)
            logo
            path

          }
        }
      }
    }
  }

   memberships: allMembership(filter: {title: {in: ["foundation", "tech"]}}){
   edges{
    node{
      id
      title
      path
    }
  }
}
}
